import React from 'react';
import PropTypes from 'prop-types';
import MenuItem from '../MenuItem/MenuItem';
import SubMenu from '../SubMenu/SubMenu';
import menuIcon from '../../../assets/icons/MenuItemIcons/MenuItemIcon.svg';

const Menu = props => {
    return (
        <nav className='mt-10 px-6 '>
            <MenuItem />
            <SubMenu>
                <MenuItem key={1} icon={menuIcon}>
                    {'SubMenu-Item'}
                </MenuItem>
            </SubMenu>
            <MenuItem key={1} icon={menuIcon}>
                {'CustomMenuItem'}
            </MenuItem>
        </nav>
    );
};

Menu.propTypes = {};

export default Menu;
